import React, {useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [user,setUser]=useState(null)

  useEffect(()=>{
    fetch('https://gitconnected.com/portfolio/TouHouPolice')
    .then(response=>response.json())
    .then(user=>{
      setUser(user)
    })
  },[])

}

export default App;
